Tafel polarization curve of symmetrical cells based on Pt, tri-carbon, MWCNT, CB, and MG electrodes

The diffusion of ionic carriers in the electrolyte with different electrodes determines transfer resistance limited current density (Jlim) for DSSCs, which can be used to evaluate the diffusion rate of ions between two counter electrodes. The Jlim obtained from the Tafel diagram is directly proportional to the diffusion coefficient (Dn) of the redox couple (the higher catalytic performance of the counter electrode, the faster diffusion rate).Jlim=2nFCDn/l\documentclass[12pt]{minimal}
