				\begin{document}$$J_{{{\text{lim}}}} = {2}nFCD_{n} /l$$\end{document}where l is the thickness of the spacer; F is the Faraday constant; and C is the electrolyte concentration [29, 30]. In the diffusion zone in Fig. 7, the Jlim values lie in the order of Pt > tri-carbon > MWCNT > CB > MG, indicating that tri-carbon can effectively catalyze the reduction of I3− and reduce the concentration near the electrode surface due to its high catalytic ability, thereby accelerating the diffusion rate of redox to the electrode surface.
